import { Button } from 'antd'
import React, { useState, useEffect } from 'react'
import { DataRequest } from '../../DataRequest/RealTimeRequestWrap'
import HMIWrapper from '../Realtime/HMIWrapper'

const Line1RT = () => {

    const test = () => {
        const res = DataRequest([],'Polymerlink','1','C3')

        .then((res) => {
            console.log(res)
          })

        
    }


    
    return (
        <div>
            <Button onClick={test}> Test R</Button>
            <HMIWrapper>
                <h3>hellow world</h3>
                
            </HMIWrapper>
        </div>
    )
}

export default Line1RT
